CREATE DATABASE  IF NOT EXISTS `bestbuy`;
USE `bestbuy`;

DROP TABLE IF EXISTS `departments`;
CREATE TABLE `departments` (
  `DepartmentID` int(11) NOT NULL AUTO_INCREMENT,
  `Name` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`DepartmentID`),
  UNIQUE KEY `DepartmentID_UNIQUE` (`DepartmentID`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

LOCK TABLES `departments` WRITE;
INSERT INTO `departments` VALUES (1,'Large Electronics'),(2,'Small Electronics'),(3,'Media'),(4,'Other');
UNLOCK TABLES;

DROP TABLE IF EXISTS `categories`;
CREATE TABLE `categories` (
  `CategoryID` int(11) NOT NULL AUTO_INCREMENT,
  `Name` varchar(45) NOT NULL,
  `DepartmentID` int(11) NOT NULL,
  PRIMARY KEY (`CategoryID`),
  UNIQUE KEY `idcategories_UNIQUE` (`CategoryID`),
  KEY `fk_departmentid_idx` (`DepartmentID`),
  CONSTRAINT `fk_departmentid` FOREIGN KEY (`DepartmentID`) REFERENCES `departments` (`DepartmentID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;

LOCK TABLES `categories` WRITE;
INSERT INTO `categories` VALUES (1,'Computers',2),(2,'Appliances',1),(3,'Phones',2),(4,'Audio',2),(5,'Home Theater',1),(6,'Printers',1),(7,'Music',3),(8,'Games',3),(9,'Services',4),(10,'Other',4);
UNLOCK TABLES;

DROP TABLE IF EXISTS `employees`;
CREATE TABLE `employees` (
  `EmployeeID` int(11) NOT NULL AUTO_INCREMENT,
  `FirstName` varchar(45) DEFAULT NULL,
  `MiddleInitial` varchar(45) DEFAULT NULL,
  `LastName` varchar(45) DEFAULT NULL,
  `EmailAddress` varchar(45) DEFAULT NULL,
  `PhoneNumber` varchar(45) DEFAULT NULL,
  `Title` varchar(45) DEFAULT NULL,
  `DateOfBirth` datetime DEFAULT NULL,
  PRIMARY KEY (`EmployeeID`),
  UNIQUE KEY `EmployeeID_UNIQUE` (`EmployeeID`)
) ENGINE=InnoDB AUTO_INCREMENT=34618 DEFAULT CHARSET=latin1;

