DROP TABLE IF EXISTS `sales`;
CREATE TABLE `sales` (
  `SalesID` int(11) NOT NULL AUTO_INCREMENT,
  `ProductID` int(11) NOT NULL,
  `Quantity` int(11) NOT NULL,
  `PricePerUnit` decimal(8,2) NOT NULL,
  `Date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `EmployeeID` int(11) DEFAULT NULL,
  PRIMARY KEY (`SalesID`),
  UNIQUE KEY `SalesID_UNIQUE` (`SalesID`),
  KEY `productid_FK_idx` (`ProductID`),
  KEY `employee_FK_idx` (`EmployeeID`),
  CONSTRAINT `employee_FK` FOREIGN KEY (`EmployeeID`) REFERENCES `employees` (`EmployeeID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `productid_FK` FOREIGN KEY (`ProductID`) REFERENCES `products` (`ProductID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=5416 DEFAULT CHARSET=latin1;

